import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Container, Card, Form, Button, Alert } from 'react-bootstrap';
import axios from 'axios';

function GoogleLoginDemo() {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    email: '',
    name: '',
    picture: ''
  });
  const [error, setError] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    try {
      const response = await axios.post('http://localhost:5000/api/auth/google/callback', formData);
      
      localStorage.setItem('token', response.data.token);
      navigate('/dashboard');
    } catch (err) {
      setError('Login failed. Please try again.');
    }
  };

  // Quick login with demo account
  const quickLogin = async () => {
    const demoData = {
      email: 'demo@gmail.com',
      name: 'Demo User',
      picture: 'https://ui-avatars.com/api/?name=Demo+User&background=667eea&color=fff&size=200'
    };

    try {
      const response = await axios.post('http://localhost:5000/api/auth/google/callback', demoData);
      
      localStorage.setItem('token', response.data.token);
      navigate('/dashboard');
    } catch (err) {
      setError('Login failed. Please try again.');
    }
  };

  return (
    <div className="min-vh-100 d-flex align-items-center justify-content-center" style={{ background: '#f5f5f5' }}>
      <Container style={{ maxWidth: '500px' }}>
        <Card>
          <Card.Body className="p-5">
            <div className="text-center mb-4">
              <img 
                src="https://www.google.com/images/branding/googlelogo/2x/googlelogo_color_272x92dp.png" 
                alt="Google" 
                style={{ width: '150px' }}
              />
              <h3 className="mt-3">Sign in with Google</h3>
              <p className="text-muted">Demo Mode - For Testing</p>
            </div>

            {error && <Alert variant="danger">{error}</Alert>}

            <Form onSubmit={handleSubmit}>
              <Form.Group className="mb-3">
                <Form.Label>Email</Form.Label>
                <Form.Control
                  type="email"
                  placeholder="your-email@gmail.com"
                  value={formData.email}
                  onChange={(e) => setFormData({...formData, email: e.target.value})}
                  required
                />
              </Form.Group>

              <Form.Group className="mb-3">
                <Form.Label>Name</Form.Label>
                <Form.Control
                  type="text"
                  placeholder="Your Name"
                  value={formData.name}
                  onChange={(e) => setFormData({...formData, name: e.target.value})}
                  required
                />
              </Form.Group>

              <Form.Group className="mb-4">
                <Form.Label>Profile Picture URL (Optional)</Form.Label>
                <Form.Control
                  type="url"
                  placeholder="https://example.com/photo.jpg"
                  value={formData.picture}
                  onChange={(e) => setFormData({...formData, picture: e.target.value})}
                />
              </Form.Group>

              <Button variant="primary" type="submit" className="w-100 mb-3">
                Continue with Google
              </Button>

              <Button variant="outline-primary" onClick={quickLogin} className="w-100">
                Quick Login (Demo Account)
              </Button>
            </Form>

            <div className="text-center mt-4">
              <Button variant="link" onClick={() => navigate('/login')}>
                ‚Üê Back to Login
              </Button>
            </div>
          </Card.Body>
        </Card>
      </Container>
    </div>
  );
}

export default GoogleLoginDemo;
